import * as React from "react";
import AppBar from "@mui/material/AppBar";
import Box from "@mui/material/Box";
import Toolbar from "@mui/material/Toolbar";
import Typography from "@mui/material/Typography";
import { Avatar, IconButton, Paper } from "@mui/material";
import Grid2 from "@mui/material/Unstable_Grid2/Grid2";
import Header from "../components/header/Header";
import Poster from "../components/Poster";


export default function Vitrin() {
    return (
        <Grid2 container flexDirection="column" gap={3} sx={{ px: 2 }}>
            <Header />
            <Poster />
            <Typography variant="h5" color="text.secondary">Recent Movies</Typography>
            <Box sx={{overflowX: 'auto'}}></Box>
        </Grid2>
    );
}
